('2540401952', 'Web Developer', 'Patna', 'India', 'IT and Telecoms', 'Full-time', '2 Years', '&nbsp;Web Developer is a professional who is&nbsp;responsible for the design and construction of websites.<br>', 'A good developer and team leader.', 'HTML<br>CSS<br>PHP<br>mysql<br>java<br>python', 'CM033614495', 'January 24, 2024', '09/03/2024', 14),
('6575605341', 'Accountant', 'Patna', 'India', 'Accounting', 'Full-time', '2 Years', 'Helps businesses make critical financial decisions by collecting, tracking, and correcting the company\'s finances.<br>', 'Accountant responsibilities&nbsp;include auditing financial documents and procedures, reconciling bank statements and calculating tax payments and returns.<br>', '<div><div><div><div>Bachelor\'s degree in accounting</div><div></div></div><div></div></div></div><div><div><div><div>Communication and interpersonal skills</div><div></div></div><div></div></div></div><div><div><div><div>Comply with financial policies and regulations</div><div></div></div><div></div></div></div><div><div><div><div>Preparing financial statements</div><div></div></div><div></div></div></div><div><div><div><div>Tax returns</div><div></div></div><div></div></div></div><div><div><div><div>Work experience as an accountant</div><div></div></div><div></div></div></div><div><div><div><div>Analytical ability</div></div></div></div>', 'CM203420302', 'January 28, 2024', '05/05/2024', 16),
('6761711867', 'Software Engineer', 'Delhi', 'India', 'Engineering and Construction', 'Full-time', '4 Years', 'Develops software solutions by studying information needs, conferring with users, and studying systems flow, data usage, and work processes.<br>', 'Software Engineer responsibilities include: · Executing full lifecycle software development&nbsp;· Programming well-designed, testable, efficient code ·<br>', '<ul><li>Bachelor\'s Degree in Software Engineering.</li><li>Software Engineering Skills.</li><li>Internship.</li><li>Entry-level Experience.</li><li>Certifications.</li></ul>', 'CM134837504', 'January 28, 2024', '05/05/2024', 17),
('7371553178', 'Hospital Business Manager', 'Mumbai', 'India', 'Marketing,Media and Brand', 'Full-time', '3 Years', 'We are looking for an experienced Hospital Business Manager to join our team at Cipla . The ideal candidate will have a minimum of 4-8 years of experience in the healthcare industry. The Hospital Business Manager will be responsible for developing and executing business strategies to increase sales and profitability of the hospital. The successful candidate will have excellent communication and interpersonal skills, be highly organized, and have the ability to work independently.\r\n<div><br></div>', '?? Develop and execute business strategies to increase sales and profitability of the hospital\r\n<br>&nbsp;• Develop and maintain relationships with key stakeholders in the hospital\r\n<br>&nbsp;• Monitor and analyze market trends and customer feedback\r\n<br><div><br></div>', '?? Bachelor’s degree in business, healthcare, or a related field <br>• 4-8 years of experience in the healthcare industry <br>• Excellent communication and interpersonal skills <br>• Highly organized and able to work independently <br>• Ability to develop and execute business strategies <br>• Knowledge of market trends and customer feedback <br>• Knowledge of competitor activities&nbsp;<br>• Develop and implement marketing plans to increase brand awareness<div><br></div>', 'CM787913213', 'January 28, 2024', '06/06/2024', 18),
('1599691063', 'Teacher', 'Patna', 'India', 'Education and Training', 'Freelance', '2 Years', 'Towards this objective, Mentors Eduserv hires people at entry level, mid level and senior positions for the various above mentioned functional departments. Very supportive work place with no work pressure all the members are very friendly and help to support me in work. Working time is very&nbsp;flexible.&nbsp;<br>', 'Teach&nbsp;and supervise students using lectures, demonstrations, discussion groups, laboratory workshop sessions, seminars, case studies.<br>', 'We are looking for people who have an excellent attitude, perseverance and a penchant to work&nbsp;in an environment charged with excellence.<br>', 'CM780110796', 'January 28, 2024', '09/04/2024', 19),
('5300449308', 'Regional HR Manager', 'Patna', 'India', 'Banking and Financial Services', 'Full-time', '4 Years', '&nbsp;supervising local HR teams, implementing company policies and designing employees\' compensation and benefits plans.&nbsp;<br>', 'Regional HR Manager responsibilities include supervising local HR teams, implementing company policies and designing employees\' compensation and benefits plans.<br>&nbsp;- Also hire and train HR personnel.\r\n<br>&nbsp;- Develop and maintain effective relationships with key stakeholders, including employees, managers, and external partners.<br>', '<div>- Bachelor\'s or master\'s degree in human resources, Business Administration or related field.\r\n<br>&nbsp;- 8+ years of experience in HR leadership roles with a proven track record of managing HR operations across multiple regions.\r\n<br>&nbsp;- Should have a good knowledge of local labor regulations and experience with Human Resources Management Software.\r\n<br>&nbsp;- Working in Bank is mandatory<div><br></div></div><div><div><div></div></div><div><div></div></div></div>', 'CM203420302', 'January 28, 2024', '10/05/2024', 20);

