('Yatra', '', '-', '-', '-', '-', 'yatra@gmail.com', '-', 'Travel And Tourism', '-', '-', '-', 'India', '-8542796541', 'Yatra Online Pvt Ltd based in Gurgaon India, is one of India\'s leading online travel companies and operates the website Yatra.com. The company provides information, pricing, availability, and booking facility for domestic and international air travel, domestic and international hotel bookings, holiday packages, buses, trains, in city activities, inter-city and point-to-point cabs, homestays and cruises. As a leading platform of accommodation options, Yatra provides real-time bookings for more than 83,000 hotels in India and over 800,000 hotels around the world.<br>', , '', '', '1-10', '28-01-2024 10:01 AM [EAT +03:00]', 'employer', 'https://www.yatra.com/', 'd6cb86a75b647124d7c7a5f486e2a533', 'CM621378167');
