('Mentors Institute', '', '-', '-', '-', '2005', 'mentors@gmail.com', '-', 'Institute', 'Patna', 'Boring Road', '6006', 'India', '456456456', 'Mentors Eduserv Private Limited (MEPL) is a Private Limited Indian Non-Government Company incorporated in India on 01 February 2012 and has a history of 11 years and 11 months.<br>', , 'Mentors Eduserv&nbsp;is the best NEET coaching in Patna. We provide the best NEET coaching classes by a team of expert faculties.<br>', 'This Faculty team has experience&nbsp;in producing great results over the years in JEE ADVANCED, JEE MAIN, NEET-UG and other Competitive and Scholarship Examinations .<br>', '11-100', '28-01-2024 09:01 AM [EAT +03:00]', 'employer', 'mentors.com', 'fa03187a6daf6976c7d89fdcb96d1d73', 'CM780110796');
